L'inflation est une augmentation globale du niveau total des prix des biens et des services queles citoyens \(ou, pour utiliser un terme statistique, les« ménages »\) achètent habituellement. ^[Tous les mois, les instituts statistiques nationaux relèvent les prix d'un panier de biens et de services représentatifs des dépenses de consommation des ménages \(biens alimentaires, électricité etgaz, loyers, carburants, etc.\). ](inherit)^[Pour calculer la variation des prix moyenne, on attribue plus de poids aux prix des produits qui constituent une part importante des dépenses des ménages, comme l’électricité, qu’à ceux des produits pour lesquels ils dépensent moins, comme le sucre ou les timbres\-poste. ](inherit)^[Si le prix de ce panier représentatif augmente, le taux d'inflation est positif. Si le prix du panier baisse, le taux d'inflation est négatif et on parle de déflation. ](inherit)^[L'inflation annuelle montre la différence entre le niveau des prix du moisen cours et celui du même mois de l'année précédente.^[
